</template>

<script>
import toast from "../../uview-ui/libs/function/toast";

export default {
  name: "storeChange",
  data() {
    return {
      list: [],
    }
  },
  onLoad() {
    this.storeList();
  },
  methods: {
    storeList() {
      this.$u.api.storeList().then((res) => {
        console.log(res);
        if (res.code == 200) {
          this.list = this.$u.deepClone(res.data);
        } else {
          this.$u.toast(res.msg)
        }
      })
    },
    change(id){
      this.$u.api.changeStore({id:id}).then((res)=>{
        if(res.code==200){
          uni.setStorageSync('storeInfo', res.data);
          uni.switchTab({
            url: '../home/homePage'
          });
        }else{
          this.$u.toast(res.msg)
        }
      })
    },
    // 续费
    presaleorderRenew(){
      this.$u.api.presaleorderRenew({openId: this.$u.func.getOpenId()}).then((res)=>{
        if(res.code==200){

        }else{
          this.$u.toast(res.msg)
        }
      })
    },
  }
}
</script>

